INSERT INTO games VALUES(115,'League of Legends','League of Legends is a fast-paced, competitive online game that blends the speed and intensity of an RTS with RPG elements. Two teams of powerful champions, each with a unique design and playstyle, battle head-to-head across multiple battlefields and game modes. With an ever-expanding roster of champions, frequent updates and a thriving tournament scene, League of Legends offers endless replayability for players of every skill level.','http://www.leagueoflegends.com','//images.igdb.com/igdb/image/upload/t_thumb/lxoumgqbbj3erxgq6a6l.jpg',3,0,3,'2018-05-01 19:53:29.973272','2018-05-01 19:54:06.219571');
INSERT INTO games VALUES(121,'Minecraft','Minecraft is an open world game that has no specific goals for the player to accomplish, allowing players a large amount of freedom in choosing how to play the game however, there is an achievement system. The gameplay by default is first person, but players have the option to play in third person mode. The core gameplay revolves around breaking and placing blocks. The game world is essentially composed of rough 3D objects—mainly cubes—that are arranged in a fixed grid pattern and represent different materials, such as dirt, stone, various ores, water, and tree trunks. While players can move freely across the world, objects and items can only be placed at fixed locations relative to the grid. Players can gather these material blocks and place them elsewhere, thus allowing for various constructions.','https://minecraft.net/','//images.igdb.com/igdb/image/upload/t_cover_big/ew1zwceoeho7lipjxi1n.jpg',218,0,2,'2018-05-01 19:53:30.563395','2018-05-02 00:12:27.261524');
INSERT INTO games VALUES(289,'Age of Empires','Age of Empires (AoE) is a history-based real-time strategy video game developed by Ensemble Studios and published by Microsoft. The game uses the Genie, a 2D sprite-based game engine. The game allows the user to act as the leader of an ancient civilization by advancing it through four ages (the Stone, Tool, Bronze, and Iron Ages), gaining access to new and improved units with each advance.','https://en.wikipedia.org/wiki/Age_of_Empires_(video_game)','//images.igdb.com/igdb/image/upload/t_thumb/lclbmfihd2crlasugy6b.jpg',228,0,6,'2018-05-01 19:53:32.517278','2018-05-02 00:12:20.327625');
INSERT INTO games VALUES(327,'Age of Empires II: The Age of Kings',replace('Take control of a powerful civilization. Lead them through 1000 years of the Middle Ages to riches and greatness. Will you Intimidate the world into following you by using military force? Rule the world with honor and nobility by using commerce and diplomacy? Or Underhandedly seize power through conspiracy, deception and regicide? There are many paths to power, there can only be one ruler!\n\nFeatures:\n\n* Travel through time as your civilization evolves from the Dark Age to the Imperial Age\n\n* Construct a rich and thriving empire by trading with allies\n\n* Control and lead military forces with tactical commands\n\n* Go into battle at the side of famous heroes such as Joan of Arc, Barbarossa or William Wallace','\n',char(10)),'http://ageofempires.wikia.com/wiki/Age_of_Empires_Series_Wiki','//images.igdb.com/igdb/image/upload/t_thumb/yoqdjsssreh8sjs9nvtv.jpg',216,0,6,'2018-05-01 19:53:33.283112','2018-05-02 00:12:27.569228');
INSERT INTO games VALUES(492,'Gears of War 3','Gears of War 3 is the spectacular conclusion to one of the most memorable and celebrated sagas in videogames. Gears of War 3 plunges players into a harrowing tale of hope, survival and brotherhood. In Gears of War 3, players fight on as Marcus Fenix, the grizzled war hero and leader of Delta Squad. Eighteen months after the fall of the last human city, the war against the Locust rages on. Meanwhile, deep beneath the surface, a fearsome new threat is infecting the planet from within. With survivors scattered and civilization in ruins, time is running out for Marcus and his comrades as they fight to save the human race.','https://gearsofwar.com/en-us/games/gears-of-war-3/xbox-360','//images.igdb.com/igdb/image/upload/t_thumb/w806olyp4jyzem47i8fd.jpg',225,0,5,'2018-05-01 19:53:34.055607','2018-05-02 00:12:28.755771');
INSERT INTO games VALUES(547,'Gears of War',replace('A third-person tactical shooter from Epic, running on the Unreal Engine 3. Gears of War thrusts gamers into a deep and harrowing story of humankind''s epic battle for survival against the Locust Horde, a nightmarish race of creatures that surface from the bowels of the planet.\n\nUnlike other shooters, Gears of War is all about teamwork in a big way. All game modes, levels and scenarios are designed specifically to encourage co-operative play, whether it be with A.I. partners or human players (with A.I. teammates designed with specific strengths, weaknesses and personalities.) On top of that, voice recognition will be available for players, and obviously voice chat to discuss strategy with your friends. In addition to voice chat, gamers will be able to experience individualized matchmaking, view player statistics, earn player achievements, customize their games, and build and personalize their gamer profiles over Xbox Live.','\n',char(10)),'http://gearsofwar.xbox.com/','//images.igdb.com/igdb/image/upload/t_thumb/tlitpk2q2sixai0cv2qi.jpg',247,0,5,'2018-05-01 19:53:34.523845','2018-05-02 00:12:25.693945');
INSERT INTO games VALUES(548,'Gears of War 2','In Gears of War 2, The COG continues its fight against the Locust horde, who are attempting to sink all of the cities on the planet Sera by using a big riftworm to eat the ground beneath them. Sergeant Marcus Fenix leads Delta Squad into the depths of the planet to try to stop the worm from eating but instead they discover the true intent of the Locust actions.','https://twitter.com/gearsofwar','//images.igdb.com/igdb/image/upload/t_thumb/nfzagyc0ktt66972xici.jpg',222,0,5,'2018-05-01 19:53:35.158123','2018-05-02 00:12:26.761389');
INSERT INTO games VALUES(990,'Halo: Reach','Experience the story before the events of Halo: Combat Evolved as you fight to defend the planet Reach from a harrowing Covenant invasion. In this first-person shooter you can customize your own Spartan with armor and accessories to experience both a pulse-pounding campaign and addictive multiplayer mode. Reach will fall, but it won''t go down without a fight.','https://www.halowaypoint.com/en-us/games/halo-reach/xbox-360','://images.igdb.com/igdb/image/upload/t_cover_big/btb2qjrmavliwaiqtuyz.jpg',216,0,4,'2018-05-01 19:53:36.189264','2018-05-02 00:12:30.908559');
INSERT INTO games VALUES(1020,'Grand Theft Auto V','The biggest, most dynamic and most diverse open world ever created, Grand Theft Auto V blends storytelling and gameplay in new ways as players repeatedly jump in and out of the lives of the game’s three lead characters, playing all sides of the game’s interwoven story.','http://www.rockstargames.com/V/','//images.igdb.com/igdb/image/upload/t_thumb/t0zqmqhdcxppyol3mtlg.jpg',200,0,5,'2018-05-01 19:53:36.562679','2018-05-02 00:12:31.043414');
INSERT INTO games VALUES(1905,'Fortnite',replace('Fortnite is the living, action building game from the developer formerly known as Epic MegaGames. You and your friends will lead a group of Heroes to reclaim and rebuild a homeland that has been left empty by mysterious darkness only known as "the Storm". \n \nBand together online to build extravagant forts, find or build insane weapons and traps and protect your towns from the strange monsters that emerge during the Storm. In an action experience from the only company smart enough to attach chainsaws to guns, get out there to push back the Storm and save the world. And don''t forget to loot all the things.','\n',char(10)),'http://fortnitegame.com','//images.igdb.com/igdb/image/upload/t_cover_big/j7lazlgtms7siqn7fn5y.jpg',228,0,2,'2018-05-01 19:53:37.865499','2018-05-02 00:12:27.963053');
INSERT INTO games VALUES(2609,'Rising Storm',replace('Rising Storm is the next game in the award-winning Red Orchestra franchise. You know the great gameplay, innovative features and realistic audio and graphics of RO2 - Rising Storm will take this to the Pacific Theater, adding even more features, new levels, new weapons and new factions. The game will allow the player to fight across iconic locations from the famous island-hopping campaigns in the Pacific from 1942 to 1945, as the US Army and Marine Corps fight it out with the Imperial Japanese army and Special Naval Landing Forces. Players will experience beach assaults, jungle fighting, close quarters night fighting and more across Guadalcanal, Iwo Jima and Saipan, among other iconic battles. The player is able to take the part of either side – American or Japanese – battling it out online in multiplayer on up to 64-player servers.\n\nRising Storm also introduces an entirely new type of gameplay to the franchise - asymmetrical warfare. The American’s have the apparent advantage in firepower with their fast firing semi-automatic rifles, fully automatic weapons, and devastating flamethrower. The Japanese balance this out with gameplay elements that model their raw courage, ferocity, and cunning use of equipment. Their knee mortars allow them to rain indirect fire down on their enemies from anywhere in the map. Grenades can be planted and turned into booby-traps for unwary GIs. The Japanese put very high store on close-quarter combat, with a bayonet on almost every weapon – even machine guns and SMGs. Their banzai charge suppresses the enemy making it difficult for them to return fire and gives them an opportunity to close in to use bayonets and katanas on their opponents.','\n',char(10)),'https://en.wikipedia.org/wiki/Rising_Storm_%28video_game%29','//images.igdb.com/igdb/image/upload/t_thumb/qw64sh49kyoy8n93173i.jpg',227,0,5,'2018-05-01 19:53:39.249892','2018-05-02 00:12:22.738154');
INSERT INTO games VALUES(2920,'FIFA 14',replace('FIFA 14 is a 2013 sports association football simulation video game developed by EA Canada and published by Electronic Arts. It was released in late September 2013 for the PlayStation 2, PlayStation 3, PlayStation Portable, PlayStation Vita, Xbox 360, Wii, Nintendo 3DS and Microsoft Windows.[3] It was released as freemium, under the title FIFA 14 Mobile, for iOS and Android on September 23, 2013[6] and for Windows Phone 8 on February 28, 2014,[9] although much of the game is inaccessible without an in-app payment. It was a launch title for the PlayStation 4 and Xbox One in November 2013[7][8] and is the last FIFA game to be released for the PlayStation 2 and PlayStation Portable.\n\nThe game received primarily positive reviews across all systems.','\n',char(10)),'http://www.ea.com/uk/fifa-14','//images.igdb.com/igdb/image/upload/t_thumb/etn5hmoke3spyxmlhoty.jpg',194,0,1,'2018-05-01 19:53:40.592646','2018-05-02 00:12:22.841631');
INSERT INTO games VALUES(2963,'Dota 2',replace('Dota 2 is a multiplayer online battle arena video game and the stand-alone sequel to the Defense of the Ancients (DotA) mod.\n\nEach match of Dota 2 involves two teams, both containing five players and occupying a fortified stronghold at either end of the map. Victory is achieved by destroying the enemy''s Ancient, a building that is invulnerable until certain objectives are achieved. Each player controls a "Hero" character and focuses on leveling up, acquiring items and fighting against the other team to achieve victory during each match.','\n',char(10)),'http://www.dota2.com/','//images.igdb.com/igdb/image/upload/t_thumb/qcx7vedma0pvf0hzisxc.jpg',234,0,6,'2018-05-01 19:53:42.280253','2018-05-02 00:12:16.257987');
INSERT INTO games VALUES(5589,'Clash of Clans','Clash of Clans is an addictive mixture of strategic planning and competitive fast-paced combats. Raise an army of Barbarians, War Wizards, Dragons and other mighty fighters. Join a clan of players and rise through the ranks, or create your own Clan to contest ownership of the Realm.','http://www.supercell.net/games/view/clash-of-clans','//images.igdb.com/igdb/image/upload/t_thumb/aui4ckfsazuiwsrxlvhe.jpg',234,0,3,'2018-05-01 19:53:35.542709','2018-05-02 00:12:26.974112');
INSERT INTO games VALUES(6803,'Halo 5: Guardians','Peace is shattered when colony worlds are unexpectedly attacked. But when humanity''s greatest hero goes missing, a new Spartan is tasked with hunting the Master Chief and solving a mystery that threatens the entire galaxy.','https://en.wikipedia.org/wiki/Halo_5:_Guardians','//images.igdb.com/igdb/image/upload/t_thumb/rzjnrhuv5rozj52g9aq3.jpg',229,0,4,'2018-05-01 19:53:43.290592','2018-05-02 00:12:25.307983');
INSERT INTO games VALUES(7313,'Heroes of the Storm','Heroes of the Storm is a multiplayer online battle arena video game currently under development by Blizzard Entertainment. The game brings together characters (known in the game as heroes) from multiple Blizzard universes, such as Warcraft and StarCraft and puts them against each other in an arena in a 5 versus 5 battle. Heroes of the Storm features multiple game modes, such as co-op (PCs vs. NPCs) and versus (PCs vs. PCs).','http://us.battle.net/heroes/en/','//images.igdb.com/igdb/image/upload/t_thumb/nam6futpzszd26us2jat.jpg',230,0,6,'2018-05-01 19:53:44.033799','2018-05-02 00:12:24.663825');
INSERT INTO games VALUES(7433,'FIFA World',replace('Play as your favourite club or country in Online Seasons or create your own unique squad to play your style of football in Ultimate Team. Challenge your friends or challenge the world – it’s the authentic FIFA experience, now FREE to play on PC.\n\nEA SPORTS™ FIFA World features award-winning EA SPORTS FIFA HD console gameplay and over 30 officially licensed leagues, 600 clubs and 16,000 players.','\n',char(10)),'https://en.wikipedia.org/wiki/FIFA_World','//images.igdb.com/igdb/image/upload/t_thumb/diemodptyfk37ap6jwjq.jpg',229,0,1,'2018-05-01 19:53:44.641205','2018-05-02 00:12:23.212341');
INSERT INTO games VALUES(7534,'TERA',replace('The unique world of TERA is home to many different inhabitants. A combination of seven playable races, each with a different culture and history, and nine playable classes give you freedom to shape your own history, in a way that you choose.\n\nExplore an enormous world full of diverse terrain and beautiful landscapes, without loading screens and zone transitions. Explore open-world dungeons and fight roaming bosses.\n\nPlayers in TERA are able to run for election in the groundbreaking political system. Choosing a province or continent, players can make a move to take over the mantle of either a Vanarch, the ruler of a province, or Exarch, the ruler of a continent. Doing so will grant the player prestige, glory and power.\n\nKeep a steady hand and know your arsenal, combat in TERA requires a quick finger and nuance on the battlefield, as most skills have to be aimed and can be dodged.\n\nBreathtaking visuals powered by Unreal Engine 3\nFeast your eyes on cutting-edge graphics never before seen in an MMO.\n\nThe enemies in TERA range from small animals to giant, towering demons and monsters. Fighting those colossal creatures is a completely different experience!\nExciting PvP battles in the Battlegrounds\nTeam up with a group of friends to battle other teams in organized battlegrounds. Prizes, glory and conquest awaits the most skilled warriors.\nSocial feature\nAdvanced guild system, auction house, mounts, achievements... everything you can expect from a complete social MMO experience!','\n',char(10)),'http://tera.enmasse.com/','//images.igdb.com/igdb/image/upload/t_cover_big/yywpkwjetgomzn1qbr8w.jpg',213,0,2,'2018-05-01 19:53:44.984334','2018-05-02 00:12:29.393468');
INSERT INTO games VALUES(7574,'FIFA 15','FIFA 15 is a football simulation game developed by EA Canada and published by Electronic Arts. FIFA 15 is the first of the series to be developed for next generation (Xbox One and PS4) consoles and also features the new Ignite game engine.','http://www.easports.com/fifa','//images.igdb.com/igdb/image/upload/t_thumb/kq2pbxsax0aufgpij41o.jpg',206,0,1,'2018-05-01 19:53:45.752147','2018-05-02 00:12:30.171467');
INSERT INTO games VALUES(11071,'FIFA 16',replace('FIFA 16 innovates across the entire pitch to deliver a balanced, authentic, and exciting football experience that lets you play your way, and compete at a higher level. You''ll have Confidence in Defending, take Control in Midfield, and you''ll produce more Moments of Magic than ever before. FIFA 16 - Play Beautiful.\n\nWith innovative gameplay features, FIFA 16 brings Confidence in Defending, Control in Midfield, and gives you the tools to create more Moments of Magic than ever before. Fans new to the franchise, or skilled players looking to improve their game will have a chance to Compete at a Higher Level using the all new FIFA Trainer. Innovation Across the Entire Pitch. New Ways to Play. Compete at a Higher Level.','\n',char(10)),'https://en.wikipedia.org/wiki/FIFA_16','//images.igdb.com/igdb/image/upload/t_thumb/z6ukyh2er3ntgeax0yew.jpg',232,0,1,'2018-05-01 19:53:54.792571','2018-05-02 00:12:29.892494');
INSERT INTO games VALUES(11133,'Dark Souls III','As fires fade and the world falls into ruin, developer FROMSOFTWARE and director Hidetaka Miyazaki continue their critically-acclaimed and genre-defining series with Dark Souls III. Fans and newcomers alike will get lost in the games hallmark rewarding gameplay and immersive graphics. Now only embers remain…','http://www.darksouls3.com/','//images.igdb.com/igdb/image/upload/t_thumb/c1mahksyzikn8eyjai8q.jpg',211,0,4,'2018-05-01 19:53:46.981094','2018-05-02 00:12:30.422099');
INSERT INTO games VALUES(11186,'Gears of War 4','A new saga begins for one of the most acclaimed video game franchises in history. After narrowly escaping an attack on their village, JD Fenix and his friends, Kait and Del, must rescue the ones they love and discover the source of a monstrous new enemy.','https://gearsofwar.com/en-us/gears-of-war-4','//images.igdb.com/igdb/image/upload/t_thumb/vo0k42jaombqazz5m12j.jpg',219,0,5,'2018-05-01 19:53:47.694197','2018-05-02 00:12:29.491444');
INSERT INTO games VALUES(11198,'Rocket League',replace('Soccer meets racing once again in our long-awaited, MP-focused sequel to Supersonic Acrobatic Rocket-Powered Battle-Cars!\n\nA futuristic Sports-Action game, Rocket League, equips players with booster-rigged vehicles that can be crashed into balls for incredible goals or epic saves across multiple, highly-detailed arenas. Using an advanced physics system to simulate realistic interactions, Rocket League relies on mass and momentum to give players a complete sense of intuitive control in this unbelievable, high-octane re-imagining of association football.','\n',char(10)),'https://www.facebook.com/RocketLeague','//images.igdb.com/igdb/image/upload/t_thumb/edkpgyqgfsxyiby9pyj5.jpg',199,0,1,'2018-05-01 19:53:48.138496','2018-05-02 00:12:28.219565');
INSERT INTO games VALUES(11544,'Paladins',replace('Paladins is a brightly colored, online, class based, first person shooter. It features Champions who have various weapons and abilities. On top of that, there is a Cards System that modifies the behaviour and abilities in certain ways.\n\nEnter a fantasy world of ancient technology in Paladins, a team-based shooter with strategy elements and deep character customization. Through a unique collectible card system, players can amplify and augment a character’s core set of abilities to play exactly how they want to play.','\n',char(10)),'http://www.paladins.com/','//images.igdb.com/igdb/image/upload/t_thumb/cqfnhpjoz4njvino6vnf.jpg',221,0,6,'2018-05-01 19:53:55.836264','2018-05-02 00:12:27.849027');
INSERT INTO games VALUES(15707,'Clash Royale',replace('Enter the Arena! From the creators of Clash of Clans comes a real-time multiplayer game starring the Royales, your favorite Clash characters and much, much more.\n\nCollect and upgrade dozens of cards featuring the Clash of Clans troops, spells and defenses you know and love, as well as the Royales: Princes, Knights, Baby Dragons and more. Knock the enemy King and Princesses from their towers to defeat your opponents and win Trophies, Crowns and glory in the Arena. Form a Clan to share cards and build your very own battle community.\n\nLead the Clash Royale Family to victory!\n\n\nFEATURES\n*Earn chests to unlock rewards, collect powerful new cards and upgrade existing ones\n*Destroy opponent’s towers and win Crowns to earn epic Crown chests\n*Build and upgrade your card collection with the Clash Royale Family along with dozens of your favorite Clash troops, spells and defenses\n*Construct your ultimate. Battle Deck to defeat your opponents\n*Progress through multiple Arenas all the way to the top\n*Form a Clan to share cards and build your very own battle community\n*Challenge your Clanmates and friends to a private duel\n*Learn different battle tactics by watching the best duels on TV Royale','\n',char(10)),'https://clashroyale.com/','//images.igdb.com/igdb/image/upload/t_thumb/c7zjtskfahqfyjyisuo5.jpg',220,0,6,'2018-05-01 19:53:49.609284','2018-05-02 00:12:10.092991');
INSERT INTO games VALUES(16707,'Duskers',replace('In Duskers you pilot drones into derelict spaceships to find the means to survive and piece together how the universe became a giant graveyard.\nYou are a drone operator, surrounded by old gritty tech that acts as your only eyes and ears to the outside world. What you hear comes through a remote microphone. What you see is how each drone sees the world. Motion sensors tell you something''s out there, but not what. And when you issue commands, you do it through a command line interface.','\n',char(10)),'http://duskers.misfits-attic.com/','//images.igdb.com/igdb/image/upload/t_thumb/tjcysk7qftugymkkxhic.jpg',230,0,6,'2018-05-01 19:53:50.299381','2018-05-02 00:12:30.304814');
INSERT INTO games VALUES(16741,'Blade & Soul','Blade & Soul is a MMORPG currently in development by NCsoft''s Team Bloodlust development team. The characters in this oriental style game are designed by the well-known illustrator Hyung-tae Kim.','http://www.bladeandsoul.com/en/','//images.igdb.com/igdb/image/upload/t_thumb/myriiu2kmjjbzuyug74j.jpg',242,0,6,'2018-05-01 19:53:57.067745','2018-05-02 00:12:27.705889');
INSERT INTO games VALUES(18116,'Barricade','Barricade is an overhead view maze arcade game released by RamTeK in 1976. Players move their blocks across the screen to create walls to try to surround their opponents and force them to crash into the walls or any block.','https://www.igdb.com/games/barricade','//images.igdb.com/igdb/image/upload/t_thumb/goj9mqykd6ryfkmhwi5l.jpg',216,0,6,'2018-05-01 19:53:51.196156','2018-05-02 00:12:11.652936');
INSERT INTO games VALUES(18138,'Pokkén Tournament',replace('Pokkén Tournament was developed with BANDAI NAMCO Entertainment, Inc., the producers of one of the top achievements in fighting games, the Tekken series. True to its legacy, this game brings tight gameplay and incredible control to never-before-seen battles between Pokémon. The gameplay is designed to be enjoyed by a wide range of people—even those who have never played a fighting game or an action game before can easily pick it up and play!\n\nKey Word: Pokke, pokkén, pokken, poken, pokén','\n',char(10)),'https://en.wikipedia.org/wiki/Pokk%C3%A9n_Tournament','//images.igdb.com/igdb/image/upload/t_thumb/fqt7lnmkdqazqybeuemf.jpg',213,0,2,'2018-05-01 19:53:52.549320','2018-05-02 00:12:28.447609');
INSERT INTO games VALUES(18166,'Rising Storm 2: Vietnam','Rising Storm 2: Vietnam is a sequel to the stand-alone expansion pack to Rising Storm and focuses on the Vietnam War.','https://en.wikipedia.org/wiki/Rising_Storm_2:_Vietnam','//images.igdb.com/igdb/image/upload/t_thumb/wpev096fih78krgnxsyy.jpg',231,0,6,'2018-05-01 19:53:51.667378','2018-05-02 00:12:19.304750');
INSERT INTO games VALUES(18320,'Battlefield 1',replace('Discover classic Battlefield gameplay with epic multiplayer and an adventure-filled campaign. Experience the Dawn of All-Out War, Only in Battlefield 1.\n\nFight your way through epic battles going from tight urban combat in a besieged French city to big open spaces in the Italian Alps or frantic combats in the Arabic sand dunes. Experience large-scale battles as infantry or piloting vehicles on land, air and sea, from the tanks and bikes on the ground, to bi-planes and gigantic battleships.\n\nDiscover a new world at war through an adventure-filled campaign, or join in epic multiplayer battles with up to 64 players. Adapt your tactics and strategy to the earth-shattering, dynamic environments and destruction.','\n',char(10)),'http://www.battlefield.com/','//images.igdb.com/igdb/image/upload/t_thumb/ts6ceuy9nu1sgwpeabmo.jpg',212,0,5,'2018-05-01 19:53:53.139575','2018-05-02 00:12:30.555877');
INSERT INTO games VALUES(19459,'FIFA 17','For the first time ever in FIFA, live your story on and off the pitch as the Premier League’s next rising star, Alex Hunter. Play on any club in the Premier league, for authentic managers and alongside some of the best players on the planet. Experience brand new worlds in FIFA 17, all while navigating your way through the emotional highs and lows of The Journey.','https://www.easports.com/fifa/the-journey','//images.igdb.com/igdb/image/upload/t_thumb/xv7upjgzdop40tvgztte.jpg',184,0,1,'2018-05-01 19:53:57.455998','2018-05-02 00:12:28.901353');
INSERT INTO games VALUES(27081,'FIFA 18','Powered by Frostbite™, EA SPORTS™ FIFA 18 blurs the line between the virtual and real worlds, bringing to life the players, teams, and atmospheres that immerse you in the emotion of The World’s Game. The biggest step in gameplay innovation in franchise history, FIFA 18 introduces Real Player Motion Technology, an all-new animation system which unlocks a new level of responsiveness, and player personality – now Cristiano Ronaldo and other top players feel and move exactly like they do on the real pitch. Player Control combined with new Team Styles and Positioning give you the tools to deliver Dramatic Moments that ignite Immersive Atmospheres around the world. The World’s Game also takes you on a global journey as Alex Hunter Returns along with a star-studded cast of characters, including Cristiano Ronaldo and other European football stars. And in FIFA Ultimate Team™, FUT ICONS, featuring Ronaldo Nazário and other football legends, are coming to FIFA 18 on PlayStation 4, Xbox One, and PC when the game launches on September 29, 2017.','https://www.easports.com/fifa/','//images.igdb.com/igdb/image/upload/t_thumb/ybvx0zc8nxkqorpfjjsp.jpg',208,0,1,'2018-05-01 19:53:58.499104','2018-05-02 00:12:30.680916');
INSERT INTO games VALUES(28540,'Assassin''s Creed: Origins',replace('For the last four years, the team behind Assassin’s Creed IV Black Flag has been crafting a new beginning for the Assassin’s Creed franchise.\n\nSet in Ancient Egypt, players will journey to the most mysterious place in history, during a crucial period that will shape the world and give rise to the Assassin’s Brotherhood. Plunged into a living, systemic and majestic open world, players are going to discover vibrant ecosystems, made of diverse and exotic landscapes that will provide them with infinite opportunities of pure exploration, adventures and challenges.\n\nPowered by a new fight philosophy, Assassin''s Creed Originsembraces a brand new RPG direction where players level up, loot, and choose abilities to shape and customize their very own skilled Assassin as they grow in power and expertise while exploring the entire country of Ancient Egypt.','\n',char(10)),'https://store.steampowered.com/app/582160','//images.igdb.com/igdb/image/upload/t_thumb/l2dza03yjs6j5u6uuak2.jpg',219,0,5,'2018-05-01 19:53:39.802779','2018-05-02 00:12:23.081811');
INSERT INTO games VALUES(36794,'Pokkén Tournament DX','Pokkén Tournament (Japanese: ポッ拳 Hepburn: Pokken) is a fighting video game developed by Bandai Namco Studios and published by The Pokémon Company. The game combines gameplay elements from Bandai Namco''s Tekken series with characters from Nintendo''s Pokémon franchise.[4] It was released for Japanese arcades in July 2015, and worldwide for the Wii U in March 2016.[5] An enhanced port for the Nintendo Switch, titled Pokkén Tournament DX, was released in September 2017.','http://www.pokkentournament.com/dx/en-us/','//images.igdb.com/igdb/image/upload/t_thumb/efib2m2zdhcy3gvem4b5.jpg',200,0,6,'2018-05-01 19:53:59.586963','2018-05-02 00:12:29.265854');
INSERT INTO games VALUES(36872,'Forza Motorsport 7','Forza is back and in 4K.','https://en.wikipedia.org/wiki/Forza_Motorsport_7','//images.igdb.com/igdb/image/upload/t_thumb/dwvsn2o0cmq6rff8xvhk.jpg',234,0,1,'2018-05-01 19:53:53.751184','2018-05-02 00:12:30.781008');
INSERT INTO games VALUES(36911,'Dragon Ball FighterZ','DRAGON BALL FighterZ is born from what makes the DRAGON BALL series so loved and famous: endless spectacular fights with its all-powerful fighters.','http://dragonball.wikia.com/wiki/Dragon_Ball_FighterZ','//images.igdb.com/igdb/image/upload/t_thumb/d3u9twanoznp5fspuzpe.jpg',198,0,3,'2018-05-01 19:54:00.084935','2018-05-02 00:12:30.022751');
INSERT INTO games VALUES(41608,'Halo: The Master Chief Collection Limited Edition',replace('Relive the greatest adventures of the ultimate solder with Halo: The Master Chief Collection, which includes the complete story of the Master Chief on one console for the first time ever. Halo: Combat Evolved , Halo 2, Halo 3 and Halo 4 are all packed into this massive package. And not only is the debut Halo delivered in its acclaimed Anniversary package, but for the first time, an entirely remastered version of the iconic sequel that revolutionized online console gaming is available with the Halo 2 Anniversary version of the game. This collection lets you experience Halo in an all-new way, at higher visual fidelity running at 60 frames per second (fps) on dedicated servers.\n\nHalo: The Master Chief Collection features curated campaign and multiplayer playlists across all four games and features more than 100 multiplayer maps -- authentic to their original release. In addition, Halo 2 Anniversary includes six all-new maps built from the ground up for Xbox One.','\n',char(10)),'https://www.igdb.com/games/halo-the-master-chief-collection-limited-edition','//images.igdb.com/igdb/image/upload/t_thumb/kuaub4pjaajuepmlxuq3.jpg',217,0,6,'2018-05-01 19:53:54.382434','2018-05-02 00:12:20.175511');
